CREATE TABLE `tasks` (
  `task_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '任务编号',
  `name` varchar(60) NOT NULL COMMENT '任务名称',
  `title` varchar(60) NOT NULL COMMENT '任务中文名称',
  `group_id` int(11) NOT NULL COMMENT '组编号',
  `user_id` int(11) NOT NULL COMMENT '用户编号',
  `start_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '任务开始时间',
  `end_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '任务结束时间',
  `span` tinyint(4) NOT NULL COMMENT '间隔周期',
  `period` enum('MINUTE','HOUR','DAY','WEEK','MONTH') NOT NULL COMMENT '任务执行周琦',
  `next_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '下次执行执行时间',
  `pool_id` int(11) NOT NULL COMMENT '数据库实例编号',
  `db_name` varchar(300) NOT NULL COMMENT '数据库名称',
  `db_type` tinyint(4) NOT NULL COMMENT '数据库类型',
  `table_name` varchar(300) NOT NULL COMMENT '表名称',
  `table_type` tinyint(4) NOT NULL COMMENT '数据库类型',
  `dims` longtext NOT NULL COMMENT '维度配置表JSON',
  `indicators` longtext NOT NULL COMMENT '指标配置表JSON',
  `sql_initial` longtext COMMENT '初始化SQL',
  `status` enum('Y','N') NOT NULL COMMENT '状态,Y正常,N关闭',
  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`task_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='任务配置表';
